Μην ξεχάσεις να κάνεις ΕΓΓΡΑΦΗ στο κανάλι!
Έχεις κάνει follow στο Instagram  ⬇
https://www.instagram.com/markos_seferlis_real/

Πόσες μέρες μπορεί ν’ αντέξει ένας άνθρωπος τρώγοντας μόνο καρύδα;
Είναι ικανός να «καρυδώσει» κάποιον λόγω στέρησης κρέατος;

Πόσο μπορεί ν’ αντέξει κάποιος χωρίς μπάνιο;
Και πόσο μπορεί ν’ αντέξει κάποιος άλλος να κοιμηθεί δίπλα του;

Πόσα κιλά μπορεί να χάσει ένας ράπερ, αν πάει σε νησί χωρίς τάπερ;

Άραγε θα ψήφιζαν 4.000 γυναίκες να παραμείνει ένας άντρας για μήνες μακριά τους,
αν είχαν μείνει ικανοποιημένες απ’ τις επιδόσεις του;

Πόσες μέρες μπορεί να μείνει μια γυναίκα άβαφτη;
Αν της μιλήσει κάποιος εκείνες τις μέρες την έβαψε;

Πόσους σταυρούς πρέπει να κάνει κάποιος, για να βγει πρώτος σε μια δοκιμασία;

Πόσα κομποσκοίνια χρειάζονται για να κερδίσει έναν Κύπριο;

Πόσες μέρες χρειάζεται μια διάσημη ξανθιά,
για να τερματίσει σε κάποιο αγώνισμα που απαιτεί αντοχή, εξυπνάδα και ταχύτητα;

Γιατί πρέπει ν’ ανάβει κάποιος φωτιές και μετά να κάνει τον Κινέζο, όταν είναι ήδη Κινέζος;

Η ανάγκη μου να δώσω σ’ αυτά τα καυτά ερωτήματα τις πιο δροσιστικές απαντήσεις,
με οδήγησε στη δημιουργία της παράστασης που θα παρακολουθήσετε σήμερα!
Πάμε λοιπόν!
Εγώ, εσείς και οι υπόλοιποι «μαχητές» της διασκέδασης να ενώσουμε τα χέρια και να φωνάξουμε όλοι μαζί… «Survivor!»

Καλή διασκέδαση!
Μάρκος Σεφερλής

